import React from 'react';

const TotalDeliveredForm = ({ totalPicked }) => {
  return (
    <div className="total-delivered-form">
      <div className="column">
        <p>Total Delivered Today:</p>
      </div>
      <div className="column">
        <p className="bold">{String(totalPicked).padStart(3, '0')}</p>
      </div>
    </div>
  );
};

export default TotalDeliveredForm;
